const SIGN_IN = {
  en: 'Sign In',
  tr: 'Giriş Yap'
}

const SIGN_UP = {
  tr: 'Kayıt Ol',
  en: 'Sign Up'
}

export const navbarLiterals = {
  SIGN_IN,
  SIGN_UP,
  SEARCH: {
    tr: 'Arama Yapın',
    en: 'Search',
  },
  WRITE: {
    tr: 'Yaz',
    en: 'Write',
  },
}

export const userAuthFormLiterals = {
  SIGN_IN,
  SIGN_UP,
  OR: {
    en: 'Or',
    tr: 'Veya'
  },
  WELCOME_BACK: {
    tr: 'Tekrar Hoşgeldiniz',
    en: 'Welcome Back',
  },
  JOIN_US_TODAY: {
    tr: 'Bugün Bize Katılın',
    en: 'Join Us Today',
  },
  CONTINUE_WITH_GOOGLE: {
    en: 'Continue with google',
    tr: 'Google ile devam edin',
  },
  DONT_HAVE_AN_ACCOUNT: {
    en: `Don't have an account?`,
    tr: 'Bir hesabınız yok mu?',
  },
  ALREADY_A_MEMBER: {
    en: 'Already a member?',
    tr: 'Zaten üye misiniz?',
  },
  SIGN_IN_HERE: {
    en: 'G'
  }
}
